// Usar las funcionalidades de React
import React from 'react';
import ReactDOM from 'react-dom/client';

// Importar el componente principal 'App' (tiene el contenido de la app)
import App from './App'; 

// Busca el elemento en el HTML con el id 'root' para mostrar la aplicación
const root = ReactDOM.createRoot(document.getElementById('root'));

// Renderiza el componente 'App' dentro de este elemento HTML
root.render(<App />);
